package genotype;

public abstract class Genotype {
	public abstract Genotype hybridize(Genotype genotype2, double randomnessFactor);
}

package genotype;

import java.util.Random;

import function.IFunction;

public class FunctionGenotype extends Genotype{
	
	private int n; //dimensions
	private double[][] P; //simplex vertices
	
	private IFunction f;
	
	private double minDomain[];
	private double maxDomain[];
	
	public FunctionGenotype(IFunction f){
		this.f=f;
		this.n=f.getDimensions();
		P=new double[n+1][n];
		minDomain=f.getLowerDomainBound();
		maxDomain=f.getUpperDomainBound();
		
		Random r = new Random();
    	for(int i=0;i<n+1;i++){
    		for(int j=0;j<n;j++){
    			
    			P[i][j] = minDomain[j] + (maxDomain[j] - minDomain[j]) * r.nextDouble();
    		}
    		
    	}	
		
	}

	public int getN() {
		return n;
	}

	public void setN(int n) {
		this.n = n;
	}

	public double[][] getP() {
		return P;
	}

	public void setP(double[][] p) {
		P = p;
	}

	public double[] getMinDomain() {
		return minDomain;
	}

	public void setMinDomain(double[] minDomain) {
		this.minDomain = minDomain;
	}

	public double[] getMaxDomain() {
		return maxDomain;
	}

	public void setMaxDomain(double[] maxDomain) {
		this.maxDomain = maxDomain;
	}


	public Genotype hybridize(Genotype gen2, double randomnessFactor) {
		
		FunctionGenotype genotype2 = (FunctionGenotype) gen2;
		FunctionGenotype gen3 = new FunctionGenotype(f);
		double[][] P3=new double[n+1][n];
		
		for(int i=0; i<n+1;i++){
			for(int j=0;j<n;j++){
				P3[i][j]=(P[i][j]+genotype2.getP()[i][j])/2;
			}
		}
		
		int k=(int) (n*randomnessFactor);
		
		Random r = new Random();
		for(int l=0; l<k;l++){
			int t= r.nextInt(n);
			for(int j=0;j<n;j++){
    			
    			P[t][j] = minDomain[j] + (maxDomain[j] - minDomain[j]) * r.nextDouble();
    		}
			
		}
		gen3.setP(P3);
		return gen3;
	}

	
	
}

package fitness_evaluator;


import exceptions.WrongGenotypeException;
import function.IFunction;
import genotype.FunctionGenotype;
import genotype.Genotype;


public class SimpleFunctionFitnessProxy implements IFitnessProxy {
	
	private IFunction f;
	private int n; //dimensions
	
	public SimpleFunctionFitnessProxy(IFunction function) {
		super();
		this.f = function;
		n=f.getDimensions();
	}

	
	private double stepResult(double[][] P){
		
		double[] pointWithHighestValue=getPointWithHighestValueFromSimplex(P);
		double highestValue=f.getValueAt(pointWithHighestValue);
		
		double[] pointWithLowestValue= getPointWithLowestValueFromSimplex(P);
		double lowestValue=f.getValueAt(pointWithLowestValue);
		
		double[] meanPoint = getMeanPointInSimplex(P, pointWithHighestValue);
		
		double[] tmpPoint = new double[n];
		for(int i=0;i<n;i++){
			tmpPoint[i]=2*meanPoint[i]-pointWithHighestValue[i];
		}
		
		double[] tmpPoint2 = new double[n];
		if(f.getValueAt(tmpPoint)<=lowestValue){
			for(int i=0;i<n;i++){
				tmpPoint2[i]=3*meanPoint[i]-pointWithHighestValue[i];
			}
		}
		else{
			for(int i=0;i<n;i++){
				tmpPoint2[i]=3*meanPoint[i]/2-pointWithHighestValue[i]/2;
			}		
		}
		
		if(f.getValueAt(tmpPoint)>=f.getValueAt(tmpPoint2)){
			//put tmpPoint2 instead of pointWithHighestValue
			for(int i=0;i<n;i++){
				pointWithHighestValue[i]=tmpPoint2[i];
			}
		}
		else{
			//put tmpPoint instead of pointWithHighestValue
			for(int i=0;i<n;i++){
				pointWithHighestValue[i]=tmpPoint[i];
			}
		}
		return lowestValue;
	}

	private double[] getPointWithHighestValueFromSimplex(double[][] P){
		double[] pointWithHighestValue;
		pointWithHighestValue=P[0];
		double highestValue;
		highestValue=f.getValueAt(P[0]);
		
		for(int i=1;i<n+1;i++){
			if(f.getValueAt(P[i])>highestValue){
				highestValue=f.getValueAt(P[i]);
				pointWithHighestValue=P[i];
			}
		}
		return pointWithHighestValue;
	}
	
	private double[] getPointWithLowestValueFromSimplex(double[][] P){
		double[] pointWithLowestValue;
		pointWithLowestValue=P[0];
		double lowestValue;
		lowestValue=f.getValueAt(P[0]);
		
		for(int i=1;i<n+1;i++){
			if(f.getValueAt(P[i])<lowestValue){
				lowestValue=f.getValueAt(P[i]);
				pointWithLowestValue=P[i];
			}
		}
		return pointWithLowestValue;
	}

	
	private double[] getMeanPointInSimplex(double[][] P, double[] pointWithHighestValue ){
		double[] meanPoint = new double[n];
		for(int i=0;i<n;i++){
			meanPoint[i]=-pointWithHighestValue[i]/n;
		}
		for(int i =0; i<n+1;i++){
			for(int j=0; j<n;j++){
				meanPoint[j]=meanPoint[j]+P[i][j]/n;
			}
		}
		return meanPoint;
	}
	
	@Override
	public Genotype createGenotype() {
		Genotype gen= new FunctionGenotype(f);
		return gen;
	}

	@Override
	public double evaluateFitness(Genotype genotype) throws WrongGenotypeException {
		
		try{
			FunctionGenotype fgenotype= (FunctionGenotype) genotype;
			if(fgenotype.getP()==null || fgenotype.getMaxDomain() == null|| fgenotype.getMinDomain()==null) throw new WrongGenotypeException(genotype);
			double[][] P=fgenotype.getP();
			return stepResult(P);
		}
		catch(Exception e){
			throw new WrongGenotypeException(genotype);
		}
	}

	

	
}

package fitness_evaluator;

import exceptions.WrongGenotypeException;
import genotype.Genotype;

public interface IFitnessProxy {
	public double evaluateFitness(Genotype genotype) throws WrongGenotypeException;
	public Genotype createGenotype();
}

package exceptions;

import genotype.Genotype;

public class WrongGenotypeException extends Exception{
	private Genotype genotype;
	public WrongGenotypeException(Genotype genotype){
		this.genotype=genotype;
	}
}

package agent;

import fitness_evaluator.IFitnessProxy;

public class AgentFactory {
	private double energyLossFactor=50;
	private double genotypeRandomnessFactor=0.2; //factor which defines the probability of mutation
	private double energyOnStart=100.0;
	
	private IFitnessProxy fitnessEvaluator;

	public AgentFactory(double energyLossFactor,
			double genotypeRandomnessFactor, double energyOnStart,
			IFitnessProxy fitnessEvaluator) {
		super();
		this.energyLossFactor = energyLossFactor;
		this.genotypeRandomnessFactor = genotypeRandomnessFactor;
		this.energyOnStart = energyOnStart;
		this.fitnessEvaluator = fitnessEvaluator;
	}

	
	
	public void setEnergyLossFactor(double energyLossFactor) {
		this.energyLossFactor = energyLossFactor;
	}



	public void setGenotypeRandomnessFactor(double genotypeRandomnessFactor) {
		this.genotypeRandomnessFactor = genotypeRandomnessFactor;
	}



	public void setEnergyOnStart(double energyOnStart) {
		this.energyOnStart = energyOnStart;
	}



	public AgentFactory(IFitnessProxy fitnessEvaluator) {
		super();
		this.fitnessEvaluator = fitnessEvaluator;
	}
	
	public Agent createAgent(){
		Agent agent = new Agent(energyOnStart, energyLossFactor, genotypeRandomnessFactor, fitnessEvaluator);
		return agent;
	}
	
}

package agent;


import exceptions.WrongGenotypeException;
import fitness_evaluator.IFitnessProxy;
import fitness_evaluator.SimpleFunctionFitnessProxy;
import function.IFunction;
import genotype.Genotype;


public class Agent{

	private double energy; 
	private double fitness;
	private Genotype genotype; 
	
	private double energyLossFactor=50;
	private double genotypeRandomnessFactor=0.2; //factor which defines the probability of mutation
	private double energyOnStart=100;

	private IFitnessProxy fitnessEvaluator;
	
	public Agent(double energyLossFactor,
			double genotypeRandomnessFactor, double energyOnStart,
			IFitnessProxy fitnessEvaluator) {
		super();
		this.energy = energyOnStart;
		this.energyLossFactor = energyLossFactor;
		this.genotypeRandomnessFactor = genotypeRandomnessFactor;
		this.energyOnStart = energyOnStart;
		this.fitnessEvaluator = fitnessEvaluator;
		this.genotype= fitnessEvaluator.createGenotype();
	}
	
	public void setEnergy(double energy) {
		this.energy = energy;
	}

	public void setFitness(double fitness) {
		this.fitness = fitness;
	}


	public Genotype getGenotype() {
		return genotype;
	}

	public void setGenotype(Genotype genotype) {
		this.genotype = genotype;
	}

	public double getEnergy() {
		return energy;
	}

	public double getFitness() {
		return fitness;
	}

	public void fight(Agent agent2) {
		if(agent2.getFitness()<fitness){
			
			agent2.energy=agent2.energy-energyLossFactor;
			energy=energy+energyLossFactor;
		}
		else{
		
			agent2.energy=agent2.energy+energyLossFactor;
			energy=energy-energyLossFactor;
		}
		
	}

	
	public Agent hybridize(Agent agent2) throws WrongGenotypeException {
		Genotype gen= genotype.hybridize(agent2.getGenotype(), genotypeRandomnessFactor);
		AgentFactory factory = new AgentFactory(energyLossFactor, genotypeRandomnessFactor, energyOnStart, fitnessEvaluator);
		
		Agent agent3 = factory.createAgent();
		agent3.setGenotype(gen);
		
		energy=energy-energyOnStart/2;
		agent2.energy=agent2.energy-energyOnStart/2;
		return agent3;
	}

}
